import React from "react";
import styled from "styled-components";

const Landing = () => {
  return (
    <Container>
      <h2>Sam's Auto</h2>
    </Container>
  );
};

export default Landing;

const Container = styled.div`
  width: 100vw;
  height: 100vh;
  background-color: #151515;
  font-family: "Quicksand", sans-serif;
  color: white;
`;
